// src/pages/LuxuryWatches.js
import React, { useState, useEffect, useCallback, useMemo } from 'react';
import ProductCard from '../components/ProductCard';

// Import luxury watch images
import HL1 from '../images/HL1.jpeg';
import HL2 from '../images/HL2.jpeg';
import HL3 from '../images/HL3.jpeg';

const LuxuryWatches = ({ watchesData, addToCart }) => {
  const [sortOption, setSortOption] = useState('default');
  const [currentPage, setCurrentPage] = useState(1);
  const [paginatedProducts, setPaginatedProducts] = useState([]);
  const productsPerPage = 3; // Changed to display only 3 watches per page

  // Create sample luxury watches data if none provided
  const luxuryWatchesData = useMemo(() => [
    {
      id: 1,
      name: "Prestige Chronograph",
      shortDescription: "Classic luxury chronograph with genuine leather strap",
      description: "Experience the pinnacle of watchmaking with this classic chronograph. Featuring a precision Swiss movement, sapphire crystal, and hand-stitched genuine leather strap.",
      price: 12500,
      image: HL1,
      features: ["Swiss automatic movement", "Sapphire crystal", "Water resistant to 100m", "Genuine leather strap"]
    },
    {
      id: 2,
      name: "Royal Collection Gold",
      shortDescription: "18K gold luxury timepiece with diamond hour markers",
      description: "A statement of excellence, this 18K gold timepiece features a handcrafted dial with diamond hour markers and a mechanical movement visible through the transparent caseback.",
      price: 18900,
      image: HL2,
      features: ["18K gold case", "Diamond hour markers", "Mechanical movement", "Alligator leather strap"]
    },
    {
      id: 3,
      name: "Heritage Automatic",
      shortDescription: "Vintage-inspired automatic watch with moonphase complication",
      description: "Inspired by designs from the golden age of watchmaking, this automatic timepiece features a moonphase complication and perpetual calendar in a slim, elegant case.",
      price: 9750,
      image: HL3,
      features: ["Automatic movement", "Moonphase complication", "Perpetual calendar", "Stainless steel bracelet"]
    }
  ], []);

  // Sort products based on selected option
  const getSortedProducts = useCallback(() => {
    const dataToSort = watchesData || luxuryWatchesData;

    switch(sortOption) {
      case 'price-low':
        return [...dataToSort].sort((a, b) => a.price - b.price);
      case 'price-high':
        return [...dataToSort].sort((a, b) => b.price - a.price);
      case 'name':
        return [...dataToSort].sort((a, b) => a.name.localeCompare(b.name));
      default:
        return dataToSort;
    }
  }, [watchesData, luxuryWatchesData, sortOption]);

  // Handle pagination
  useEffect(() => {
    const sortedProducts = getSortedProducts();
    const startIndex = (currentPage - 1) * productsPerPage;
    const endIndex = startIndex + productsPerPage;
    setPaginatedProducts(sortedProducts.slice(startIndex, endIndex));
  }, [currentPage, sortOption, watchesData, getSortedProducts]);

  const handleSortChange = (e) => {
    setSortOption(e.target.value);
    setCurrentPage(1); // Reset to first page when sorting changes
  };

  const totalProducts = watchesData ? watchesData.length : luxuryWatchesData.length;
  const totalPages = Math.ceil(totalProducts / productsPerPage);

  return (
    <div className="category-page">
      <div className="category-header">
        <div className="category-banner" style={{ backgroundImage: `url(${HL1})` }}>
          <h1>Luxury Watches</h1>
          <p>Timeless elegance and precision craftsmanship</p>
        </div>
      </div>

      <div className="category-controls">
        <div className="product-count">
          <span>{totalProducts} products</span>
        </div>
        <div className="sort-options">
          <label htmlFor="sort">Sort by:</label>
          <select 
            id="sort" 
            value={sortOption} 
            onChange={handleSortChange}
          >
            <option value="default">Featured</option>
            <option value="price-low">Price: Low to High</option>
            <option value="price-high">Price: High to Low</option>
            <option value="name">Name: A to Z</option>
          </select>
        </div>
      </div>

      {/* Adjusted the grid to better accommodate 3 products */}
      <div className="products-grid grid-cols-3">
        {paginatedProducts.map(product => (
          <ProductCard 
            key={product.id} 
            product={product} 
            addToCart={addToCart}
          />
        ))}
      </div>

      {/* Pagination controls */}
      {totalPages > 1 && (
        <div className="pagination">
          <button 
            onClick={() => setCurrentPage(prev => Math.max(prev - 1, 1))}
            disabled={currentPage === 1}
            className="pagination-btn"
          >
            Previous
          </button>

          <span className="page-indicator">
            Page {currentPage} of {totalPages}
          </span>

          <button 
            onClick={() => setCurrentPage(prev => Math.min(prev + 1, totalPages))}
            disabled={currentPage === totalPages}
            className="pagination-btn"
          >
            Next
          </button>
        </div>
      )}
    </div>
  );
};

export default LuxuryWatches;
